INSERT INTO `posts` VALUES (11, '寻找遗失的蓝色背包 - 6月27日丢失在北京朝阳区', '6月27日下午，我在北京朝阳区光华路附近丢失了一个蓝色背包。背包内有重要文件和个人物品。如果有好心人捡到，请联系我。非常感谢！\n\n联系方式: 123-456-7890', '匿名', '2024-06-28 18:58:42', '找物-背包', 0, 0, 3, 1);
INSERT INTO `posts` VALUES (21, '寻找创业大学生伙伴共同试水创业计划 qq 528493721', '你好墙墙，帮忙投一下稿\n\n有没有想创业的大学生小伙伴我们可以来聊一聊，我有一个创业计划想要在学校试试，有想要一起的吗？qq 528493721\n\n谢谢墙墙啦', '528493721', '2024-06-28 19:28:07', '找人-创业', 0, 0, 3, 1);
INSERT INTO `posts` VALUES (22, '寻找丢失的粉色大行李袋', '时间: 今天10:00~11:00左右  地点: 东12宿舍门口垃圾堆旁  描述: 一个粉色的大行李袋，我的。到宿舍门口觉得太重了，就放在了那里，也没多久就不见了。长这样，我没有贴上姓名（见下图）。', '匿名', '2024-06-28 19:32:11', '找物-行李', 0, 0, 3, 0);
INSERT INTO `posts` VALUES (23, '寻找蓝色外壳粉色内里带卡小钱包', '想问问这几天有没有人在老区捡到一个小钱包，外壳是蓝色的，里面是粉色的，里面有好几张卡。', '匿名', '2024-06-28 19:35:06', '找物-钱包', 0, 0, 3, 1);
INSERT INTO `posts` VALUES (24, '关于孤独感的建议', '你问到明明和家人、朋友有很多，关系都不错，但还是会有强烈的孤独感。这种情况下该怎么做。这种孤独感可能有很多原因，以下是一些建议来帮助缓解这种感觉：\n\n1. **自我反思**：尝试找出孤独感的具体来源，是因为对某种情感的需求未被满足，还是因为对人际关系有更高的期望。\n\n2. **提升自我接纳**：有时候孤独感来自于对自己的不满，尝试接受自己的不完美，培养对自己的接纳和爱护。\n\n3. **寻求专业帮助**：如果孤独感严重影响了你的生活，可以考虑寻求心理咨询师的帮助，他们可以提供专业的指导和支持。\n\n4. **增加社交活动的质量**：尝试与家人和朋友进行更深层次的交流，分享内心的感受和想法，而不仅仅是表面的互动。\n\n5. **培养兴趣爱好**：找到让自己感兴趣的活动和爱好，通过这些活动来丰富自己的生活，增加满足感。\n\n6. **加入社区或团体**：参与志愿者活动或兴趣小组，结识更多志同道合的人，扩大自己的社交圈。\n\n希望这些建议对你有所帮助。如果有进一步的问题或需要更多支持，随时可以再联系。', '匿名', '2024-06-28 19:54:21', '求建议-孤独感', 0, 0, 3, 1);
