INSERT INTO `posts` VALUES (29, '寻找创业合作伙伴', '大家好，我最近在寻找有志于创业的朋友，如果你有相关的想法或正在筹备创业，欢迎一起交流合作。期待与你们共同探讨创业的无限可能！', '匿名', '2024-06-28 21:26:07', '找人-创业', 0, 0, 3, 1);
